import React, { Component } from 'react';
import Aux from '../../hoc/Aux'
import { connect } from 'react-redux'
import classes from './HelpView.css'
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';

class Permissions extends Component {
  render() {
    return (
      <Aux>

        <h1>
          Help View Controller
        </h1>
        <div className={classes.Container}>
          <div className={classes.menuItemContainer}></div>
          <div className={classes.mobileScreenContainer}>
            <DragDropContext>
              <Droppable droppableId="helpView">
                {
                  (provided) => (<ul {...provided.droppableProps} ref={provided.innerRef}>
                    <Draggable key={"first"} draggableId={"first"} index={0}>
                      {(provided) => (
                        <li ref={provided.innerRef} {...provided.draggableProps} {...provided.dragHandleProps}>
                          First Card
                        </li>)}
                    </Draggable>
                    <Draggable key={"second"} draggableId={"second"} index={1}>
                      {(provided) => (
                        <li ref={provided.innerRef} {...provided.draggableProps} {...provided.dragHandleProps}>
                          Second Card

                        </li>)}
                    </Draggable>

                  </ul>)
                }
              </Droppable>
            </DragDropContext>
          </div>

        </div>
      </Aux >
    )
  }
}
const mapStateToProps = state => {
  return {
  };
};
export default connect(mapStateToProps)(Permissions);
